/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `trg_delete_records_after_unenroll` AFTER DELETE ON `enrollment` FOR EACH ROW BEGIN
	DECLARE msg VARCHAR(100);
    SET msg = CONCAT('Trigger for deletion of', old.student_id, ' created');
  -- Delete lab observations
  DELETE FROM lab_observation
  WHERE student_id = OLD.student_id
    AND course_code = OLD.course_code;

  -- Delete mid term exam records
  DELETE FROM mid_term_exam
  WHERE student_id = OLD.student_id
    AND course_code = OLD.course_code;

  -- Delete report records
  DELETE FROM report
  WHERE student_id = OLD.student_id
    AND course_code = OLD.course_code;
	INSERT INTO trigger_log (message, ts) VALUES (msg, NOW());	

END */;;
