/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `trg_before_delete_faculty` BEFORE DELETE ON `faculty` FOR EACH ROW BEGIN
  DECLARE new_faculty_id INT;
	DECLARE msg VARCHAR(100);
    SET msg = CONCAT('Trigger for deletion of', OLD.faculty_id, ' created');

  -- Check if another faculty is teaching the same course
  SELECT faculty_id
  INTO new_faculty_id
  FROM teaches
  WHERE course_code IN (
    SELECT course_code
    FROM teaches
    WHERE faculty_id = OLD.faculty_id
  )
  LIMIT 1;

  -- If another faculty is handling the course, update students with the new faculty
  IF new_faculty_id IS NOT NULL THEN
    UPDATE enrollment
    SET faculty_id = new_faculty_id
    WHERE course_code IN (
      SELECT course_code
      FROM teaches
      WHERE faculty_id = OLD.faculty_id
    );
  END IF;
  INSERT INTO trigger_log (message, ts) VALUES (msg, NOW());
END */;;
DELIMITER ;
