CREATE DEFINER=`root`@`localhost` FUNCTION `GetLabPercentage`(stdid INT, cc VARCHAR(10)) RETURNS decimal(5,2)
    DETERMINISTIC
BEGIN
  DECLARE total INT;
  DECLARE max_marks INT;

  SELECT SUM(marks_out_of_25)
  INTO total
  FROM Lab_Observation
  WHERE student_id = stdid AND course_code = cc;

  SELECT COUNT(*) * 25
  INTO max_marks
  FROM Lab_Observation
  WHERE student_id = stdid AND course_code = cc;

  IF max_marks = 0 THEN
    RETURN 0;
  END IF;

  RETURN ROUND((total / max_marks) * 100, 2);
END ;;
