CREATE DEFINER=`root`@`localhost` FUNCTION `getMidtermPercentage`(stdid INT, cc VARCHAR(10)) RETURNS decimal(5,2)
    DETERMINISTIC
BEGIN
  DECLARE midterm_mark INT;
  DECLARE percentage DECIMAL(5,2);

  SELECT marks_out_of_25 INTO midterm_mark
  FROM Mid_term_Exam
  WHERE student_id = stdid AND course_code = cc;

  IF midterm_mark IS NULL THEN
    SET percentage = 0;
  ELSE
    SET percentage = ROUND((midterm_mark / 25) * 100, 2);
  END IF;
  INSERT INTO trigger_log (message) VALUES ('trigger fired');

  RETURN percentage;
END ;;
DELIMITER ;
