CREATE DEFINER=`root`@`localhost` PROCEDURE `enrollStudent`(
  IN stdid INT,
  IN cc VARCHAR(10),
  IN fid INT
)
BEGIN
  IF NOT EXISTS (
    SELECT * FROM Enrollment WHERE student_id = stdid AND course_code = cc
  ) THEN
    INSERT INTO Enrollment (student_id, course_code, faculty_id)
    VALUES (stdid, cc, fid);
  END IF;
END ;;
