CREATE DEFINER=`root`@`localhost` PROCEDURE `InsertOrUpdateReport`()
BEGIN
  DECLARE done INT DEFAULT FALSE;
  DECLARE sid INT;
  DECLARE cc VARCHAR(10);
  DECLARE midterm_pct DECIMAL(5,2);
  DECLARE lab_pct DECIMAL(5,2);
  DECLARE total DECIMAL(5,2);

  -- Cursor for ALL student-course combinations from enrollment
  DECLARE cur CURSOR FOR
    SELECT student_id, course_code
    FROM enrollment;

  -- Handler must come AFTER all variable and cursor declarations
  DECLARE CONTINUE HANDLER FOR SQLEXCEPTION, NOT FOUND SET done = TRUE;

  OPEN cur;

  read_loop: LOOP
    FETCH cur INTO sid, cc;
    IF done THEN
      LEAVE read_loop;
    END IF;

    BEGIN
      -- Safely get percentages with default values
      SET midterm_pct = IFNULL(getMidtermPercentage(sid, cc), 0);
      SET lab_pct = IFNULL(GetLabPercentage(sid, cc), 0);

      -- Only proceed if at least one component exists
      IF midterm_pct > 0 OR lab_pct > 0 THEN
        -- Compute weighted total marks (adjust weights as needed)
        SET total = ROUND((0.25 * midterm_pct + 0.75 * lab_pct), 2);

        -- Insert or update
        INSERT INTO Report (course_code, student_id, generated_date, total_marks)
        VALUES (cc, sid, CURDATE(), total)
        ON DUPLICATE KEY UPDATE
          generated_date = CURDATE(),
          total_marks = total;
      END IF;
    END;
  END LOOP;

  CLOSE cur;
END ;;
DELIMITER ;
