CREATE DEFINER=`root`@`localhost` PROCEDURE `UpsertStudentReport`(
    IN stdid INT,
    IN cc VARCHAR(10)
)
BEGIN
    DECLARE c DECIMAL(5,2);
    DECLARE m DECIMAL(5,2);
    DECLARE total DECIMAL(5,2);

    -- Call existing functions
    SET c = IFNULL(GetLabPercentage(stdid, cc), 0);
    SET m = IFNULL(getMidtermPercentage(stdid, cc), 0);

    SET total = 0.75 * c + 0.25 * m;

    -- Insert or update the report table based on student_id and course_code combination
    INSERT INTO Report (course_code, student_id, generated_date, total_marks)
    VALUES (cc, stdid, CURDATE(), total)
    ON DUPLICATE KEY UPDATE
        generated_date = CURDATE(),
        total_marks = total;
END ;;
